INSERT INTO `app_novel` VALUES (24, 2, 'https://www.23us.so/xiaoshuo/14823.html', '我真不是开玩笑', '被星际时代大文学家记忆撑爆大脑，唐准醒来后发现重生在了平行世界。 书写出脑海中的星际时代道韵图，普通人中的天才们看了就可以暂时觉醒异能，一步步向真正异能者进化，唐准面临的问题是如何让更多普通人看到道韵图。 观看的天才越多，觉醒的越多，他能被天才们觉醒回馈的力量也越强大，21世纪网络发达，网络传播道韵图，看我的书可以获得异能，这不是开玩笑。 （ps：企鹅天才群三三九八四三六。）', '曾经拥有的方向感', '[{\"name\":\"第001章 重生平行世界\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743814.html\"},{\"name\":\"第002章 你读书读傻了？\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743815.html\"},{\"name\":\"第003章 神书，神书啊！\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743816.html\"},{\"name\":\"第004章 可是这本书？\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743817.html\"},{\"name\":\"第005章 文大你是人么\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743818.html\"},{\"name\":\"第006章 这也是没谁了\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743819.html\"},{\"name\":\"第007章 梦想者的悲哀\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743820.html\"},{\"name\":\"第008章 没有对比就没有伤害\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743821.html\"},{\"name\":\"第009章 这条才是金大腿\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743822.html\"},{\"name\":\"第010章 不是编辑们想醉\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743823.html\"},{\"name\":\"第011章 霸气，牛，我服！\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743824.html\"},{\"name\":\"第012章 那不是高冷是近视\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743825.html\"},{\"name\":\"第013章 书呆子进社会？\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743826.html\"},{\"name\":\"第014章 你识趣我也不会为难你\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743827.html\"},{\"name\":\"第015章 现在完全崩盘了\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743828.html\"},{\"name\":\"第016章 他基本立于不败之地了\",\"url\":\"https://www.23us.so/files/article/html/14/14823/7743829.html\"},{\"name\":\"第017章 那个老司机太可恨了\",\"url\":\"https://www.23us.so/fil